import React, { useRef } from 'react';

const Index = React.memo(({ increament, multipy }) => {
    const renders = useRef(0);
    console.log("renders", renders.current++);
    return (
        <>
            <React.Fragment>
                <button style={{ border: 'none', width: 200, background: 'lightblue', padding:4 }} onClick={() => increament(5)}>Increment</button>
                <button style={{ border: 'none', width: 200, background: 'lightblue', padding:4 }} onClick={() => multipy(2)}>Multi</button>
            </React.Fragment>
        </>
    )
});

export default Index;
